private fun getDelimiterTokenType(c:Char):IElementType {
when (c) {
'"' -> return MarkdownTokenTypes.DOUBLE_QUOTE
'\'' -> return MarkdownTokenTypes.SINGLE_QUOTE
'(' -> return MarkdownTokenTypes.LPAREN
')' -> return MarkdownTokenTypes.RPAREN
'[' -> return MarkdownTokenTypes.LBRACKET
']' -> return MarkdownTokenTypes.RBRACKET
'<' -> return MarkdownTokenTypes.LT
'>' -> return MarkdownTokenTypes.GT
else -> return MarkdownTokenTypes.BAD_CHARACTER
}
}


/**
 * Unpacks the compressed character translation table.
 *
 * @param packed   the packed character translation table
 * @return         the unpacked character translation table
 */
  private fun zzUnpackCMap(packed:String):CharArray {
var size = 0
run({ var i = 0
val length = packed.length
while (i < length)
{
size += packed[i].toInt()
i += 2
} })
val map = CharArray(size)
var i = 0  /* index in packed string  */
var j = 0  /* index in unpacked array */
while (i < packed.length)
{
var count = packed[i++].toInt()
val value = packed[i++]
do map[j++] = value while (--count > 0)
}
return map
}
